function EncodedUTF8ToBig5SUB(str, table) {

	if (str[0] == "%") {
	
		// var idxstr = str.substring(0, 3).toLowerCase();
		var idxstr = str.substring(0, 3).toUpperCase();
	  
		if (table[idxstr]) {
	 
			var r = table[idxstr];
			var rtype = typeof r;
			
			if (rtype == 'string') {
		 
				return {
			 
					"left": str.substring(3),
					"result": r
				};   
			} 
			else {
			
				return EncodedUTF8ToBig5SUB(str.substring(3), r);
			}
		}	 
		else {
	 
			return {
		 
				"left": str.substring(3),
				"result": idxstr
			};
		}
  } 
	else {
	
    return {
		
			"left": str.substring(1),
			"result": str[0]
		};
  }
}

function EncodedUTF8ToBig5(str) {

  var left = str;
  var converted = '';
	
	var cr;

  while (left.length > 0) {
	
    cr = EncodedUTF8ToBig5SUB(left, EncodedUTF8ToBig5TABLE);
		
    left = cr.left;
    converted += cr.result;
  }

  return converted;
}